import React, {Component} from 'react'
import Collection from './Collection'

export default class Entradas extends Collection {


    render() {

        const {entradas} = this.state
        return(
            <div className="p-2">

                {entradas && entradas != undefined ? 
                entradas.filter(d => new Date(d) - new Date() > 0)+
                entradas.map((post, key) => 
                    <div key={key} className="col-12 p-3 bg-light rounded shadow">
                        {/* <p className="col-12 text-right">{Math.abs(new Date() - post.data.time.getTime)}</p> */}
                        <p>{post.data.user}: {post.data.post}</p>
                    </div>
                ) : null }

            </div>
        )
    }
}
